quis`.`zone_name` like '%701%') then (select `units`.`name` from `units` where (`units`.`id` = 17)) when (`dequis`.`zone_name` like '%702%') then (select `units`.`name` from `units` where (`units`.`id` = 18)) when (`dequis`.`zone_name` like '%900%') then (select `units`.`name` from `units` where (`units`.`id` = 19)) when (`dequis`.`zone_name` like '%950%') then (select `units`.`name` from `units` where (`units`.`id` = 20)) when (`dequis`.`zone_name` like '%530%') then (select `units`.`name` from `units` where (`units`.`id` = 21)) when (`dequis`.`zone_name` like '%550%') then (select `units`.`name` from `units` where (`units`.`id` = 22)) end) AS `area`,`dequis`.`progress` AS `progress`,count(0) AS `modeled`,(case when (`dequis`.`zone_name` like '%-EQ/T') then 0 when (`dequis`.`zone_name` like '%-EQ/C') then 0 when (`dequis`.`zone_name` like '%-EQUI-C') then 0 when (`dequis`.`zone_name` like '%-EQUI-K') then 13 when (`dequis`.`zone_name` like '%-EX/EQ') then 18 when (`dequis`.`zone_name` like '%-EQUI-S') then 5 when (`dequis`.`zone_name` like '%-EQ/E') then 14 when (`dequis`.`zone_name` like '%-EQUI-E') then 14 when (`dequis`.`zone_name` like '%-EX/EQ-MO') then 17 when (`dequis`.`zone_name` like '%/EQ-MO') then 17 when (`dequis`.`zone_name` like '%-EQUI-X') then 15 when (`dequis`.`zone_name` like '%-EQ/P') then 11 when (`dequis`.`zone_name` like '%-EQUI-P') then 11 when (`dequis`.`zone_name` like '%-EQUI-R') then 1 else 19 end) AS `tequis_id`,(select `tequis`.`name` from `tequis` where (`tequis`.`id` = `tequis_id`)) AS `type_equi`,(select `tequis`.`hours` from `tequis` where (`tequis`.`id` = `tequis_id`)) AS `hours`,(select `pequis`.`name` from `pequis` where (`pequis`.`percentage` = `dequis`.`progress`)) AS `status`,((((select `tequis`.`hours` from `tequis` where (`tequis`.`id` = `tequis_id`)) * count(0)) * `dequis`.`progress`) / 100) AS `mult_progress`,(select sum(`equisview`.`est_hours`) AS `mult_estimated` from `equisview`) AS `mult_estimated`,((((select `tequis`.`hours` from `tequis` where (`tequis`.`id` = `tequis_id`)) * count(0)) * `dequis`.`progress`) / (select sum(`equisview`.`est_hours`) AS `mult_estimated` from `equisview`)) AS `total_progress` from `dequis` group by `dequis`.`zone_name`,`dequis`.`progress` ;

